import React, { Component } from "react";
import Navigation from "../components/Navigation";


class Login extends Component {
    render() {
        return (
            <div>
                <Navigation />

                <div className="container">
                    <div className="form-login">
                        <div className="inside-form">
                            <h1>SIGN IN</h1>
                            <p>Login with email if you already have account</p>
                        </div>
                        <div className="text-group-label">
                            <input type="text" className="text-label" name="username" placeholder="Email *" value="" />
                        </div>
                        <div className="text-group-label">
                            <input type="password" className="text-label" name="password" placeholder="Password *" value="" />
                        </div>
                    </div>

                </div>


            </div>

        )
    }
}

export default Login;
